import React,{ Component } from "react";
import './User.css'
class User extends Component {
    render() { 
        const {myArRslt}=this.props;
        const myVar=myArRslt.map(e =>{
            return(
                <div>
                    <table>
                        <tr>
                        <th>name</th>
                        <th>age</th>
                        <th>salaire</th>
                        </tr>
                        <tr>
                            <td>{e.name}</td>
                            <td>{e.age}</td>
                            <td>{e.salair}</td>
                        </tr>
                    </table>
                </div>
            )
        }) 
        return ( 
           <div className="App">
           {myVar}
           </div>
         );
    }
}
 
export default User;
